import Card from "react-bootstrap/Card";
import Button from "react-bootstrap/Button";
function CelebretiesBox(props) {
  return (
    <Card style={{ width: "18rem" }}>
      <Card.Img
        variant="top"
        src="https://img.search.brave.com/vA74am6tIKPW-2lfknJ6b3bHrvx1Igj_XCSJVUp4awA/rs:fit:1024:769:1/g:ce/aHR0cHM6Ly93d3cu/Y2hlYXRzaGVldC5j/b20vd3AtY29udGVu/dC91cGxvYWRzLzIw/MTkvMTIvUmloYW5u/YS0yLTEwMjR4NzY5/LmpwZw"
      />
      <Card.Body>
        <Card.Title>Card Title</Card.Title>
        <Card.Text>
          Some quick example text to build on the card title and make up the
          bulk of the card's content.
        </Card.Text>
        <Button variant="primary">Go somewhere</Button>
      </Card.Body>
    </Card>
  );
}

export default CelebretiesBox;
